const ed11yHr="<hr aria-hidden='true' class='ed11y-hr'>",ed11yNewTab="<span class='ed11y-visually-hidden'>(Відкривається у новій вкладці)</span>",ed11yLang={LANG_CODE:"ua",MAIN_TOGGLE_LABEL:"Перевірка доступності",CONTAINER_LABEL:"Засіб перевірки доступності",ERROR:"Помилка",WARNING:"Попередження",GOOD:"Добре",ON:"Увімкнено",OFF:"Вимкнено",ALERT_TEXT:"Попередження",ALERT_CLOSE:"Закрити",SHOW_OUTLINE:"Контури",HIDE_OUTLINE:"Контури",SHOW_SETTINGS:"Налаштування",HIDE_SETTINGS:"Налаштування",PAGE_OUTLINE:"Контури сторінки",SETTINGS:"Налаштування",CONTRAST:"Контраст",FORM_LABELS:"Назви форми",LINKS_ADVANCED:"Посилання (Розширені)",DARK_MODE:"Темний режим",SHORTCUT_SCREEN_READER:"Перейти до проблеми. Комбінація клавіш: Option крапка",SHORTCUT_TOOLTIP:"Перейти до проблеми",SUSPICIOUS_ALT_STOPWORDS:["зображення","графічний об’єкт","малюнок","фото"],PLACEHOLDER_ALT_STOPWORDS:["alt","зображення","фото","декоративне","фотографія","заповнювач","зображення-заповнювач","роздільник"],PARTIAL_ALT_STOPWORDS:["натиснути","натиснути тут","натиснути тут щоб дізнатися більше","натиснути тут для отримання додаткової інформації","натиснути тут для отримання додаткової інформації.","перевірити","завантажити","завантажити тут","дізнатися","дізнатися більше","дізнатися більше.","дізнатися більше >","форма","тут","тут.","інфа","інформація","посилання","взнати","взнати більше","взнати більше.","взнати більше >","вивчити","більше","більше >","сторінка","стаття","прочитати більше","читати","читати це","читати це >","це","ця сторінка","ця сторінка.","цей вебсайт","цей вебсайт.","переглянути","переглянути наш","вебсайт","."],WARNING_ALT_STOPWORDS:["< "," >","натиснути тут"],NEW_WINDOW_PHRASES:["зовнішнє","нова вкладка","нове вікно","спливаюче вікно","спливаючий елемент"],FILE_TYPE_PHRASES:["документ","електронна таблиця","робочий аркуш","встановити","відео","pdf","пдФ","doc","docx","word","mp3","ppt","текст","pptx","powerpoint","txt","exe","dmg","rtf","Віндовс","Мак","csv","xls","xlsx","mp4","mov","avi","zip"],PANEL_HEADING:"Перевірка доступності",PANEL_STATUS_BOTH:(s,n)=>`Помилки <span class="ed11y-panel-count ed11y-margin-right">${s}</span> Попередження <span class="ed11y-panel-count">${n}</span>`,PANEL_STATUS_ERRORS:s=>`Помилки <span class="ed11y-panel-count">${s}</span>`,PANEL_STATUS_WARNINGS:s=>`Попередження <span class="ed11y-panel-count">${s}</span>`,PANEL_STATUS_NONE:"Помилок не знайдено.",PANEL_ICON_WARNINGS:s=>`${s} <span class="ed11y-visually-hidden">знайдені попередження.</span>`,PANEL_ICON_TOTAL:s=>`${s} <span class="ed11y-visually-hidden">всього знайдених проблем.</span>`,NOT_VISIBLE_ALERT:"Елемент, який ви намагаєтеся переглянути, не відображується; можливо, він прихований або знаходиться усередині компонента вкладки чи випадаючого списку («акордеону»). Ось попередній перегляд:",ERROR_MISSING_ROOT_TARGET:s=>`Було здійснено перевірку доступності всієї сторінки, оскільки цільова область <span class="ed11y-kbd">${s}</span> не існує.`,LANG_READABILITY:"Читабельність",LANG_AVG_SENTENCE:"Середня кількість слів в одному реченні:",LANG_COMPLEX_WORDS:"Складні слова:",LANG_TOTAL_WORDS:"Слова:",LANG_VERY_DIFFICULT:"Дуже складно",LANG_DIFFICULT:"Складно",LANG_FAIRLY_DIFFICULT:"Достатньо складно",LANG_GOOD:"Добре",HEADING_NON_CONSECUTIVE_LEVEL:(s,n)=>`Використано непослідовні рівні заголовків. Заголовки ніколи не повинні пропускати рівні або переходити від <strong>заголовка ${s}</strong> до <strong class='ed11y-red-text'>заголовка ${n}</strong>.`,HEADING_EMPTY:s=>`Знайдено порожній заголовок! Щоб виправити, видаліть цей рядок або змініть його формат: замість <strong class='ed11y-red-text'>Заголовок ${s}</strong> оберіть <strong>Звичайний</strong> або <strong>Абзац</strong>.`,HEADING_LONG:s=>`Заголовки задовгі! Заголовки слід використовувати для організації змісту та передачі структури. Вони мають бути короткими, інформативними та унікальними. Будь ласка, не виходьте за 160 символів (не більше одного речення).\n        ${ed11yHr}\n        Кількість символів: <strong class='ed11y-red-text'>${s}</strong>`,HEADING_FIRST:`Першим заголовком на сторінці зазвичай повинен бути Заголовок 1 або Заголовок 2. Заголовок 1 має бути початком частини основного змісту та є основним заголовком, що описує загальну мету сторінки. Дізнайтеся більше про <a href='https://www.w3.org/WAI/tutorials/page-structure/headings/' target='_blank' rel='noopener noreferrer'>структуру заголовків. ${ed11yNewTab}</a>`,HEADING_MISSING_ONE:`Відсутній Заголовок 1. Заголовок 1 повинен бути початком області основного змісту та є основним заголовком, який описує загальну мету сторінки. Дізнайтеся більше про <a href='https://www.w3.org/WAI/tutorials/page-structure/headings/' target='_blank' rel='noopener noreferrer'>структуру заголовків. ${ed11yNewTab}</a>`,HEADING_EMPTY_WITH_IMAGE:s=>`Заголовок не має тексту, але містить зображення. Якщо це не заголовок, змініть його формат: замість <strong class='ed11y-red-text'>Заголовок ${s}</strong> поставте <strong>Звичайний</strong> або <strong>Абзац</strong>. В іншому разі додайте текст заміщення до зображення, якщо воно не є декоративним.`,PANEL_HEADING_MISSING_ONE:"Відсутній заголовок 1!",LINK_EMPTY:"Видаліть пусті посилання без тексту.",LINK_EMPTY_LINK_NO_LABEL:`Посилання не має тексту для розпізнавання, який є видимим для читання з екрана та інших допоміжних технологій. Щоб виправити:\n        <ul>\n            <li>Додайте короткий текст, який описує куди веде посилання.</li>\n            <li>У разі коли це посилання на <a href='https://a11y-101.com/development/icons-and-links' target='_blank' rel='noopener noreferrer'>іконку або SVG, то, швидше за все, відсутній опис. ${ed11yNewTab}</a></li>\n            <li>Якщо ви вважаєте, що це помилкове посилання викликане сбоєм копіювання/вставки, розгляньте його видалення.</li>\n        </ul>`,LINK_LABEL:s=>`<strong>Назва посилання:</strong> ${s}`,LINK_STOPWORD:s=>`Текст посилання може бути недостатньо описовим поза контекстом: <strong class='ed11y-red-text'>${s}</strong>\n        ${ed11yHr}\n        <strong>Порада!</strong> Текст посилання завжди має бути чітким, унікальним та змістовним. Уникайте поширених слів типу &quot;натисніть тут&quot; або &quot;дізнатися більше&quot;.`,LINK_BEST_PRACTICES:s=>`Розгляньте можливість заміни тексту посилання: <strong class='ed11y-red-text'>${s}</strong>\n        ${ed11yHr}\n        <ul>\n            <li>&quot;Натисніть тут&quot; стосується механіки миші, позаяк багато людей не користуються мишею або можуть переглядати цей вебсайт на мобільному пристрої. Розгляньте можливість використання іншого дієслова, що стосується виконання завдання.</li>\n            <li>Уникайте використання символів HTML у якості закликів до дії, якщо вони не приховані для допоміжних технологій.</li>\n        </ul>`,LINK_URL:()=>`Довгі, менш розбірливі URL-адреси, які використовуються як текст посилання, можуть бути складними для прослуховування з використанням допоміжних технологій. У більшості випадків замість URL краще використовувати текст, придатний для читання людиною. Короткі URL-адреси (такі як  домашня сторінка сайту) цілком допустимі. \n        ${ed11yHr}\n        <strong>Порада!</strong> Текст посилання завжди має бути чітким, унікальним та значущім, щоб його можна було зрозуміти поза контекстом.`,NEW_TAB_WARNING:`Посилання відкривається у новій вкладці або вікні без попередження. Це може дезорієнтувати, особливо людей, які мають труднощі зі сприйняттям візуального контенту. До того ж, не завжди добре контролювати чийсь досвід чи приймати рішення за іншу особу. У тексті посилання вказуйте, що посилання відкривається у новому вікні. \n        ${ed11yHr}\n        <strong>Порада!</strong> Вивчіть найкращі практики: <a href='https://www.nngroup.com/articles/new-browser-windows-and-tabs/'>відкриття посилань у нових вікнах та вкладках браузера.</a>`,FILE_TYPE_WARNING:`Посилання вказує на PDF або файл, що завантажується (наприклад, MP3, Zip, Word Doc) без попередження. Вкажіть тип файлу у тексті посилання. Якщо це великий файл, вкажіть його розмір.\n        ${ed11yHr}\n        <strong>Приклад:</strong> Виконавчий звіт (PDF, 3 МБ)`,LINK_IDENTICAL_NAME:s=>`Посилання має той самий текст, що й інше посилання, але вказує на іншу сторінку. Декілька посилань з однаковим текстом можуть заплутати людей, які використовують програми для читання з екрана.\n        ${ed11yHr}\n        Розгляньте можливість зробити наступне посилання більш описовим, щоб відрізнити його від інших посилань: <strong class='ed11y-red-text'>${s}</strong>`,MISSING_ALT_LINK_BUT_HAS_TEXT_MESSAGE:"Зображення використовується як посилання з оточуючим текстом, хоча атрибут текст заміщення повинен бути позначений як декоративний або нульовий.",MISSING_ALT_LINK_MESSAGE:"Зображення використовується як посилання, але відсутній текст заміщення! Переконайтеся, що текст заміщення описує, куди веде посилання.",MISSING_ALT_MESSAGE:"Відсутній текст заміщення! Якщо зображення передає історію, настрій або важливу інформацію, обов'язково опишіть його.",LINK_IMAGE_BAD_ALT_MESSAGE:(s,n)=>`Знайдено розширення файлу в текст заміщенняі. Переконайтеся, що текст заміщення описує місце призначення посилання, а не надає дослівний опис зображення. Видалити: <strong class='ed11y-red-text'>${n}</strong>.\n        ${ed11yHr}\n        <strong>текст заміщення:</strong> ${s}`,LINK_IMAGE_PLACEHOLDER_ALT_MESSAGE:s=>`Виявлено не описовий або заповнюючий текст заміщення усередині зв'язаного зображення. Переконайтеся, що текст заміщення визначає місце призначення посилання, а не надає дослівний опис зображення. Замініть наступний текст: <strong class='ed11y-red-text'>${s}</strong>`,LINK_IMAGE_SUS_ALT_MESSAGE:(s,n)=>`Допоміжні технології вже вказують, що це зображення, тому &quot;<strong class='ed11y-red-text'>${n}</strong>&quot; або &quot;${n} of&quot; можуть бути зайвими. Переконайтеся, що текст заміщення описує місце призначення посилання, а не надає дослівний опис зображення. \n        ${ed11yHr} \n        <strong>текст заміщення:</strong> ${s}`,LINK_ALT_HAS_BAD_WORD_MESSAGE:(s,n)=>`Знайдено розширення файлу в текст заміщенняі. Якщо зображення передає історію, настрій або важливу інформацію, обов'язково опишіть його. Видалити: <strong class='ed11y-red-text'>${n}</strong>.\n        ${ed11yHr} \n        <strong>текст заміщення:</strong> ${s}`,ALT_PLACEHOLDER_MESSAGE:s=>`Виявлено не описовий або заповнюючий текст заміщення. Замініть наступний текст заміщення чимось більш значущим: <strong class=' ed11y-red-text'>${s}</strong>`,ALT_HAS_SUS_WORD:(s,n)=>`Допоміжні технології вже вказують, що це зображення, тому &quot;<strong class='ed11y-red-text'>${n}</strong>&quot; можуть бути зайвими.\n        ${ed11yHr}\n        <strong>текст заміщення:</strong> ${s}`,LINK_IMAGE_ARIA_HIDDEN:"Посилання навколо зображення має <span class='ed11y-kbd'>aria-hidden=&quot;true&quot;</span> але все одно фокусується клавіатурою. Якщо ви бажаєте приховати зайве або дубльоване посилання, додайте також: <span class='ed11y-kbd'>tabindex=&quot;-1&quot;</span>",LINK_IMAGE_NO_ALT_TEXT:"Зображення у посиланні позначене як декоративне, а текст посилання відсутній. Будь ласка, додайте до зображення текст заміщення, який визначає місце призначення посилання.",LINK_IMAGE_HAS_TEXT:"Зображення позначене як декоративне, хоча посилання використовує навколишній текст як описову назву.",LINK_IMAGE_LONG_ALT:(s,n)=>`Опис текст заміщенняу на пов'язаному зображенні <strong>занадто довгий.</strong> текст заміщення на пов'язаних зображеннях повинен вказувати, куди веде посилання, а не містити дослівний опис зображення. <strong>Розгляньте можливість використання заголовка сторінки в якості текст заміщенняу, яку веде посилання.</strong>\n        ${ed11yHr} \n        <strong>текст заміщення (<span class='ed11y-red-text ed11y-bold'>${n}</span> символів):</strong> ${s}`,LINK_IMAGE_ALT_WARNING:s=>`Посилання на зображення містить текст заміщення, однак переконайтеся, що текст заміщення описує сторінку місця призначення. <strong>Розгляньте можливість використання заголовка сторінки, на яку веде посилання, у якості текст заміщенняа.</strong> Чи описує текст заміщення, куди веде посилання? \n        ${ed11yHr}\n        <strong>текст заміщення:</strong> ${s}`,LINK_IMAGE_ALT_AND_TEXT_WARNING:s=>`Посилання на зображення містить як текст заміщення, так і <strong>текст навколишнього посилання.</strong> Якщо зображення є декоративним і використовується як функціональне посилання на іншу сторінку, розгляньте можливість помітити зображення як декоративне або нульове ‒ тексту навколишнього посилання має бути достатньо. \n        ${ed11yHr}\n        <strong>текст заміщення:</strong> ${s}`,IMAGE_FIGURE_DECORATIVE:`Зображення позначене як <strong>декоративне</strong> та буде проігноровано допоміжними технологіями.\n        ${ed11yHr} \n        Незважаючи на наявність підпису, у більшості випадків зображення також повинно містити текст заміщення. \n        <ul>\n            <li>текст заміщення повинен містити короткий опис того, що зображенно.</li>\n            <li>Підпис зазвичай повинен надавати контекст, щоб встановити зв’язок зображення з навколишнім змістом, або привернути увагу до певної інформації.</li>\n        </ul>\n        Дізнайтесь більше: <a href='https://thoughtbot.com/blog/alt-vs-figcaption#the-figcaption-element' target='_blank' rel='noopener noreferrer'>: alt (текст заміщення) в порівнянні з figcaption (підписом). ${ed11yNewTab}</a>`,IMAGE_FIGURE_DUPLICATE_ALT:s=>`Не використовуйте однакові слова для текст заміщенняу та підпису. Пристрої читання з екрана будуть зчитувати їх двічі.\n        <ul>\n        <li>текст заміщення повинен містити короткий опис того, що зображенно.</li>\n        <li>Підпис зазвичай повинен надавати контекст, щоб встановити зв’язок зображення з навколишнім змістом, або привернути увагу до певної інформації.</li>\n        </ul>\n        Дізнайтесь більше: <a href='https://thoughtbot.com/blog/alt-vs-figcaption#the-figcaption-element' target='_blank' rel='noopener noreferrer'>: alt (текст заміщення) в порівнянні з figcaption (підписом). ${ed11yNewTab}</a>\n        ${ed11yHr}\n        <strong>текст заміщення:</strong> ${s}`,IMAGE_DECORATIVE:"Зображення позначене як <strong>декоративне</strong> та буде проігноровано допоміжними технологіями. Якщо зображення передає історію, настрій або важливу інформацію, переконайтесь, що до нього додано текст заміщення.",IMAGE_ALT_TOO_LONG:(s,n)=>`Опис текст заміщенняу задовгий. текст заміщення має бути коротким, але змістовним, як твіт (близько 100 символів). Якщо це складне зображення або діаграма, подумайте про те, щоб помістити довгий опис зображення в текст нижче або в компонент випадаючого списку (акордеону). \n        ${ed11yHr} \n        <strong>текст заміщення (<span class='ed11y-red-text ed11y-bold'>${n}</span> символів):</strong> ${s}`,IMAGE_PASS:s=>`<strong>текст заміщення:</strong> ${s}`,LABELS_MISSING_IMAGE_INPUT_MESSAGE:"На кнопці зображення не вистачає текст заміщенняу. Будь ласка, додайте текст заміщення, щоб надати доступну назву. Наприклад: <em>Пошук</em> або <em>Подати</em>.",LABELS_INPUT_RESET_MESSAGE:`Кнопки перезавантаження не слід використовувати без необхідності, оскільки їх легко активувати помилково. \n        ${ed11yHr} \n        <strong>Порада!</strong> Дізнайтеся, чому <a href='https://www.nngroup.com/articles/reset-and-cancel-buttons/' target='_blank' rel='noopener noreferrer'>кнопки перезавантаження та відміни викликають проблеми зі зручністю використання.${ed11yNewTab}</a>`,LABELS_ARIA_LABEL_INPUT_MESSAGE:s=>`Введення має доступне ім'я, проте, будь ласка, переконайтеся, що у нього є видимий підпис.\n        ${ed11yHr} \n        Доступне ім'я для цього введення: <span class='ed11y-bold'>${s}</span>`,LABELS_NO_FOR_ATTRIBUTE_MESSAGE:s=>`Із цим введенням не пов'язана жодна назва. Додайте атрибут <span class='ed11y-kbd'>for</span> що відповідає ідентифікатору цього входу. \n        ${ed11yHr} \n        Ідентифікатор цього входу: <strong>id=&#34;${s}&#34;</strong>`,LABELS_MISSING_LABEL_MESSAGE:"Із цим введенням не пов'язана жодна назва. Будь ласка, додайте <span class='ed11y-kbd'>id</span> до цього введення та додайте відповідний атрибут <span class='ed11y-kbd'>for</span> до назви.",EMBED_VIDEO:"Будь ласка, переконайтеся, що всі <strong>відеоматеріали мають приховані титри.</strong> Надання титрів для всіх аудіо- та відеоматеріалів є обов'язковою вимогою рівня А. Титри допомагають людям з порушенням слуху або глухотою.",EMBED_AUDIO:"Будь ласка, забезпечте транскрипцію всіх подкастів. Надання розшифровки аудіоконтенту є обов'язковою вимогою рівня А. Транскрипція допомагає людям з порушенням слуху або глухотою, але можуть бути корисні всім. Розгляньте можливість розміщення транскрипції нижче або всередині випадаючого списку (акордеону).",EMBED_DATA_VIZ:`Віджети візуалізації даних, подібні до цього, часто викликають труднощі у людей, які використовують клавіатуру або програму читання з екрана для навігації, і можуть становити значні труднощі для людей із слабким зором або дальтоніків. Рекомендується надавати ту саму інформацію в альтернативному (текстовому або табличному) форматі під віджетом. \n        ${ed11yHr}\n        Дізнайтеся більше про <a href='https://www.w3.org/WAI/tutorials/images/complex/' target='_blank' rel='noopener noreferrer'> комплексні зображення. ${ed11yNewTab}</a>`,EMBED_TWITTER:`Стрічка Twitter, яка використовується за замовчанням, може викликати проблеми з доступністю для людей, які використовують клавіатуру для навігації. До того ж, вбудована прокрутка стрічки Twitter може викликати проблеми зі зручністю використання для мобільних пристроїв. Рекомендується додати наступні атрибути даних до коду вставки.  \n        ${ed11yHr}\n        <strong>Рекомендується:</strong>\n        <ul>\n            <li>Додайте <span class='ed11y-kbd'>data-tweet-limit=&#34;2&#34;</span> щоб обмежити кількість твітів.</li>\n            <li>Додайте <span class='ed11y-kbd'>data-chrome=&#34;nofooter noheader&#34;</span> щоб видалити заголовок та виноску віджету.</li>\n        </ul>`,EMBED_MISSING_TITLE:`Вбудований контент потребує доступної назви, що описує його вміст. Вкажіть унікальний <span class='ed11y-kbd'>заголовок</span> або атрибут <span class='ed11y-kbd'>aria-label</span> на елементі <span class='ed11y-kbd'>iframe</span>. Дізнайтесь більше про <a href='https://dequeuniversity.com/tips/provide-iframe-titles' target='_blank' rel='noopener noreferrer'>iFrames. ${ed11yNewTab}</a>`,EMBED_GENERAL_WARNING:`Неможливо перевірити вбудований вміст. Будь ласка, переконайтеся, що зображення мають текст заміщення, до відео є титри, текст має достатній контраст, а інтерактивні <a href='https://webaim.org/techniques/keyboard/' target='_blank' rel='noopener noreferrer'>компоненти доступні для клавіатури. ${ed11yNewTab}</a>`,QA_BAD_LINK:s=>`Знайдено неякісне посилання. Схоже, що посилання вказує на середовище розробки.\n        ${ed11yHr}\n        Це посилання вказує на:\n        <br>\n        <strong class='ed11y-red-text'>${s}</strong>`,QA_BAD_ITALICS:"Теги жирним шрифтом і курсивом мають змістовне значення і <strong>не</strong> повинні використовуватися для виділення цілих абзаців. Жирний текст слід використовувати для виділення слова або фрази. Курсив слід використовувати для виділення власних назв (наприклад, назв книг і статей), іноземних слів, цитат. Довгі цитати слід оформлювати як блокові цитати.",QA_PDF:s=>`PDF-файли вважаються веб-контентом і повинні бути доступні. PDF-файли часто створюють проблеми для користувачів програм читання з екрана (відсутні структурні теги або відсутні мітки полів форми) і для людей зі слабким зором (текст не розгортається під час збільшення). \n        <ul>\n            <li>Якщо це форма, розгляньте можливість використання доступної HTML-форми у якості альтернативи.</li>\n            <li>Якщо це документ, розгляньте можливість перетворення його на веб-сторінку.</li>\n        </ul>\n        В іншому випадку, перевірте <strong class='ed11y-red-text'>${s}</strong> <a href='https://www.adobe.com/accessibility/products/acrobat/using-acrobat-pro-accessibility-checker.html' target='_blank' rel='noopener noreferrer'>файли PDF на доступність у Acrobat DC. ${ed11yNewTab}</a>`,QA_PAGE_LANGUAGE:`Мова сторінки не вказана! Будь ласка, <a href='https://www.w3.org/International/questions/qa-html-language-declarations' target='_blank' rel='noopener noreferrer'>вкажіть мову в тезі HTML. ${ed11yNewTab}</a>`,QA_PAGE_TITLE:`Відсутня назва сторінки! <a href='https://developer.mozilla.org/en-US/docs/Web/HTML/Element/title' target='_blank' rel='noopener noreferrer'>Укажіть назву сторінки. ${ed11yNewTab}</a>`,QA_BLOCKQUOTE_MESSAGE:s=>`Це заголовок? <strong class='ed11y-red-text'>${s}</strong> \n        ${ed11yHr}\n        Блок-цитати слід використовувати лише для цитат. Якщо це задумано як заголовок, змініть блокову цитату на змістовний заголовок (наприклад, Заголовок 2 або Заголовок 3).`,TABLES_MISSING_HEADINGS:`Відсутні заголовки таблиць! Доступні таблиці потребують HTML-розмітки, яка вказує на клітинки заголовків та клітинки даних, визначаючи їх взаємозв'язок. Ця інформація надає контекст для людей, які використовують допоміжні технології. Таблиці слід використовувати лише для табличних даних.\n        ${ed11yHr}\n        Дізнайтеся більше про <a href='https://www.w3.org/WAI/tutorials/tables/' target='_blank' rel='noopener noreferrer'>доступні таблиці. ${ed11yNewTab}</a>`,TABLES_SEMANTIC_HEADING:`Семантичні заголовки, такі як Заголовок 2 або Заголовок 3, слід використовувати лише для розділів вмісту; над таблицях HTML. Вказуйте заголовки таблиць за допомогою елемента <span class='ed11y-kbd'>&lt;th&gt;</span>.\n        ${ed11yHr}\n        Дізнайтеся більше про <a href='https://www.w3.org/WAI/tutorials/tables/' target='_blank' rel='noopener noreferrer'>доступні таблиці. ${ed11yNewTab}</a>`,TABLES_EMPTY_HEADING:`Знайдено порожній заголовок таблиці! Заголовки таблиць ніколи не повинні бути порожніми. Важливо позначати заголовки рядків та/або стовпців, щоб передавати їх зв'язок. Ця інформація забезпечує контекст для людей, які використовують допоміжні технології. Пам'ятайте, що таблиці слід використовувати лише для табличних даних. Дізнайтеся більше про доступні таблиці.\n        ${ed11yHr}\n        Дізнайтеся більше про <a href='https://www.w3.org/WAI/tutorials/tables/' target='_blank' rel='noopener noreferrer'>доступні таблиці. ${ed11yNewTab}</a>`,QA_FAKE_HEADING:s=>`Це заголовок? <strong class='ed11y-red-text'>${s}</strong>\n        ${ed11yHr}\n        Рядок жирного тексту може виглядати як заголовок, але людина, яка використовує програму читання з екрана, не зможе визначити його важливість або перейти до його змісту. Жирний текст ніколи не повинен замінювати змістовні заголовки (від заголовка 2 до заголовка 6).`,QA_SHOULD_BE_LIST:s=>`Ви намагаєтесь створити список? Знайдено можливий елемент списку: <strong class='ed11y-red-text'>${s}</strong>\n        ${ed11yHr} \n        Переконайтеся, що ви використовуєте змістовні списки, вживаючи маркування або нумерацію. У разі використання змістовного списку допоміжні технології можуть передавати таку інформацію, як загальна кількість елементів та відносне положення кожного елемента у списку. Дізнайтесь більше про <a href='https://www.w3.org/WAI/tutorials/page-structure/content/#lists' target='_blank' rel='noopener noreferrer'>змістовні списки. ${ed11yNewTab}</a>`,QA_UPPERCASE_WARNING:"Знайдено  текст великими літерами. Деякі програми читання з екрана можуть інтерпретувати текст, написаний великими літерами, як абревіатуру і читати кожну літеру окремо. Крім того, деяким людям важче читати текст, написаний великими літерами, і він може виглядати як КРИК.",QA_DUPLICATE_ID:s=>`Виявлено <strong>дублікат ID</strong>. Відомо, що помилки дублювання ID можуть викликати проблеми для допоміжних технологій, коли вони намагаються взаємодіяти із вмістом.\n        ${ed11yHr} \n        Будь ласка, видаліть або змініть наступний ідентифікатор: <strong class='ed11y-red-text'>${s}</strong>`,QA_TEXT_UNDERLINE_WARNING:"Підкреслений текст можна переплутати з посиланнями. Розгляньте можливість використання іншого стилю, наприклад &lt;strong&gt;<strong>сильного акценту</strong>&lt;/strong&gt; або &lt;em&gt;<em>наголос</em>&lt;/em&gt;.",CONTRAST_ERROR:(s,n)=>`Цей текст недостатньо контрастний щодо фону. Коефіцієнт контрастності має бути не менше 4,5:1 для звичайного тексту та 3:1 для великого тексту. \n        ${ed11yHr} \n        Коефіцієнт контрастності становить <strong class='ed11y-red-text'>${s}</strong> для даного тексту: <strong class='ed11y-red-text'>${n}</strong>`,CONTRAST_WARNING:s=>`Контрастність цього тексту не встановлена і потребує перевірки вручну. Переконайтеся, що текст і фон мають різко контрастні кольори. Коефіцієнт контрастності має бути не менше 4,5:1 для звичайного тексту та 3:1 для великого тексту.  \n        ${ed11yHr}\n        <strong>Будь ласка, перевірте:</strong> ${s}`,CONTRAST_INPUT_ERROR:s=>`Текст у цьому введенні недостатньо контрастний щодо фону. Коефіцієнт контрастності має бути не менше 4,5:1 для звичайного тексту та 3:1 для великого.  \n        ${ed11yHr} \n        Коефіцієнт контрастності: <strong class='ed11y-red-text'>${s}</strong>`,READABILITY_NO_P_OR_LI_MESSAGE:'Неможливо визначити показник читабельності. Не знайдено жодного абзацу <span class="ed11y-badge">&lt;p&gt;</span> або вмісту списку <span class="ed11y-badge">&lt;li&gt;</span>.',READABILITY_NOT_ENOUGH_CONTENT_MESSAGE:"Недостатньо вмісту для розрахунку оцінки читабельності."};
//# sourceMappingURL=/sm/fd8912fb01724aef4781b3f7bd4d2b215550095db287f7409bca5188d9488d1e.map